import React from 'react';
import { Button } from "@material-ui/core";
import AddIcon from '@material-ui/icons/Add';
import "./css/sidebar.css";
import Sidebaroptions from './Sidebaroptions';
import InboxIcon from "@material-ui/icons/Inbox";
import StarRateIcon from "@material-ui/icons/StarRate";
import WatchLaterIcon from "@material-ui/icons/WatchLater";
import LabelImportantIcon from "@material-ui/icons/LabelImportant";
import SendIcon from "@material-ui/icons/Send";
import DraftsIcon from "@material-ui/icons/Drafts";
import LabelIcon from "@material-ui/icons/Label";
import DeleteIcon from "@material-ui/icons/Delete";
import FindInPageIcon from "@material-ui/icons/FindInPage";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";
import VideocamIcon from "@material-ui/icons/Videocam";
import KeyboardIcon from "@material-ui/icons/Keyboard";



function Sidebar() {
    return (
        <div className='sidebar'>
            <Button startIcon={<AddIcon />}
                className="compose__btn">Compose</Button>

            <Sidebaroptions Icon={InboxIcon} title="Inbox" number="224" isactive={true} />
            <Sidebaroptions Icon={StarRateIcon} title={"Starred"} number={500} />
            <Sidebaroptions Icon={WatchLaterIcon} title={"Snoozed"} number={300} />
            <Sidebaroptions Icon={LabelImportantIcon} title={"Important"} number={452} />
            <Sidebaroptions Icon={SendIcon} title={"Sent"} number={254} />
            <Sidebaroptions Icon={DraftsIcon} title={"Drafts"} number={310} />
            <Sidebaroptions Icon={LabelIcon} title={"Category"} number={300} />
            <Sidebaroptions Icon={DeleteIcon} title={"[Map]/Trash"} number={300} />
            <Sidebaroptions Icon={FindInPageIcon} title={"Document"} number={300} />
            <Sidebaroptions Icon={ExpandMoreIcon} title={"More"} number={300} />

            <h3 class></h3>
            <Sidebaroptions Icon={VideocamIcon} title={"Call"} number={300} />
            <Sidebaroptions Icon={KeyboardIcon} title={"Board"} number={300} />
        </div >
    )
}

export default Sidebar;
